import express from "express";
import mongoose from "mongoose";
import rootRouter from "./src2/Routes/rootRouter.js";

//서버
const app = express();

const port = 4000;

app.listen(port, () => {
  console.log(`mypage-server:http://localhost:${port}✅`);
});

app.use("/", rootRouter);

//몽고디비
mongoose.connect("mongodb://127.0.0.1:27017/til", {
  useNewUrlParser: true,
  useUnifiedTopology: true,
  pw: process.env.PRIVATE_KEY,
});
const db = mongoose.connection;
db.on("error", (error) => console.log("❌ DB ERROR", error));
db.once("open", () => console.log("Mongodb 연결성공!"));
